import React, { useContext } from 'react'
import Form from '../Components/Form'
import { Context } from '../Components/utils/Context'

//Este componente debera ser estilado como "dark" o "light" dependiendo del theme del Context

const Contact = () => {


    
  const { state , fetchData } =  useContext(Context)
  
  const style = {
    backgroundColor: state.theme === 'light' ? "#FFFFFF" : "#757575" , 
  }


  return (
    <div style={style} className='contactContainer'>
      <h2 style={{ marginLeft: '80px'}}>Want to know more?</h2>
      <p style={{ marginLeft: '50px'}}>Send us your questions and we will contact you</p>
      <Form/>
    </div>
  )
}

export default Contact
